import React from 'react'
import './Nav.css'
import avatar from '../../assets/hacker.png'

const Nav = () => {
  return (
    <>
    <div className="nav">
        <img src="https://assets.stickpng.com/images/580b57fcd9996e24bc43c529.png" alt="" />
        <img src={avatar} alt="" />
    </div>
    </>
  )
}

export default Nav;
